    playbackData.comments = {"ev-0":[{"id":"commentId-0","displayCommentEvent":{"id":"ev-0","timestamp":1660861172321,"createdByDevGroupId":"devGroupId-1","eventSequenceNumber":0,"permanentRelevance":"never relevant","type":"CREATE DIRECTORY","directoryId":"dirId-0","directoryPath":"/","parentDirectoryId":null},"developerGroupId":"devGroupId-1","timestamp":1660861172323,"commentText":"<div>Elixir is a functional programming language. Functions are first class citizens.&nbsp;A function does not have any 'state'. It accepts data and then transforms it into new data.<br></div><div><br></div><div>Most object-oriented programmers produce objects that hold on to their own copy of data or 'state'. When different objects share the same state in a multi-processor environment then there can be\n contention for it and some very strange errors can occur.&nbsp;Immutable (or unchangeable) data and 'stateless' functions help to solve this problem.</div>","commentTitle":"","selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"ev-34":[{"id":"commentId-1","displayCommentEvent":{"id":"ev-34","timestamp":1660861207989,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":34,"type":"INSERT","fileId":"fileId-0","character":"d","previousNeighborId":"ev-33","lineNumber":3,"column":3,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1660862103963,"commentText":"<div>In Elixir, functions live in modules. The highlighted code is how you create a module. This one is called <span style=\"font-family: Courier;\">NameFormatter</span>. Module names always start with a capital letter. Notice the <span style=\"font-family: Courier;\">defmodule</span>, <span style=\"font-family: Courier;\">do</span>, and <span style=\"font-family: Courier;\">end</span>&nbsp;that define where the module begins and ends.<br></div><div><br></div><div>Modules are a way to organize the functions in your programs. You may think this is unnecessary until you have dozens, hundreds, or thousands of functions. Then it will make sense to break them up in some logical way so that you know where to look for them.</div><div><br></div><div>Modules also provide a way to avoid naming collisions. So, <span style=\"font-family: Courier;\">to_string</span> in a <span style=\"font-family: Courier;\">TextProcessing</span> module will not get confused with <span style=\"font-family: Courier;\">to_string</span> in a&nbsp;<span style=\"font-family: Courier;\">Knitting</span> module&nbsp;or a&nbsp;<span style=\"font-family: Courier;\">Physics</span> module.&nbsp;Elixir can keep them all straight by associating the functions with a named module.<br></div>","commentTitle":"Modules","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"defmodule NameFormatter do\n  \nend","startRow":0,"startColumn":0,"endRow":2,"endColumn":3}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/03.exs","viewableBlogText":"defmodule NameFormatter do\n  \nend","commentTags":[],"questionCommentData":null}],"ev-80":[{"id":"commentId-2","displayCommentEvent":{"id":"ev-80","timestamp":1660861225069,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":80,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-79","lineNumber":4,"column":6,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1660862115992,"commentText":"<div>Inside a module one can add functions.&nbsp;<span style=\"font-family: Courier;\">def</span>, <span style=\"font-family: Courier;\">do</span>, and <span style=\"font-family: Courier;\">end</span> define the function. All functions in a module have a name and a parameter list.</div><div><br></div><div>The function on lines 2-4 will take three parameters for a name like:<br><span style=\"font-style: italic;\">\"Mark\" \"Robert\" \"Mahoney\"</span></div><div><br></div><div>and will format them into something that looks like this:</div><div><span style=\"font-style: italic;\">\"Mahoney, Mark R.\"</span></div><div><br></div><div>This is the <span style=\"font-family: Courier;\">format</span> function that I will build next.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"def format(first, middle, last) do\n    \n  end","startRow":1,"startColumn":2,"endRow":3,"endColumn":5}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":1,"linesBelow":1,"currentFilePath":"/03.exs","viewableBlogText":"defmodule NameFormatter do\n  def format(first, middle, last) do\n    \n  end\nend","commentTags":[],"questionCommentData":null}],"ev-124":[{"id":"commentId-3","displayCommentEvent":{"id":"ev-124","timestamp":1660861241441,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":124,"type":"INSERT","fileId":"fileId-0","character":"\"","previousNeighborId":"ev-123","lineNumber":3,"column":48,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660862134646,"commentText":"<div>All functions automatically return the value of the last statement inside of it. There is no <span style=\"font-family: Courier;\">return</span> keyword like in some other languages.<br></div><div><br></div><div>This function takes a person's full name as parameters. Then it&nbsp;returns a new string with the formatted name.</div><div><br></div><div>On line 3 I use the <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/String.html\">String</a></span> module's <span style=\"font-family: Courier;\"><a href=\"https://hexdocs.pm/elixir/String.html#first/1\">first</a></span> function to return the first character of a string. In this case, it is the initial of a person's middle name.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"\"#{last}, #{first} #{String.first(middle)}.\"","startRow":2,"startColumn":4,"endRow":2,"endColumn":48}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":2,"linesBelow":2,"currentFilePath":"/03.exs","viewableBlogText":"defmodule NameFormatter do\n  def format(first, middle, last) do\n    \"#{last}, #{first} #{String.first(middle)}.\"\n  end\nend","commentTags":[],"questionCommentData":null}],"ev-215":[{"id":"commentId-4","displayCommentEvent":{"id":"ev-215","timestamp":1660861250866,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":215,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-214","lineNumber":8,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660862161285,"commentText":"<div>To call a function in a module one uses the module name, a dot, and then the function name. The parameters come after. <br></div><div><br></div><div>On line 7, I call the <span style=\"font-family: Courier;\">format</span> function and pass in my full name. Then the name is formatted and a new string is returned and bound to <span style=\"font-family: Courier;\">formatted_name</span>.&nbsp;</div><div><br></div><div>I use&nbsp;<span style=\"font-family: Courier;\">IO.puts</span> to print the result. The attached screenshot shows the output of running this program.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"NameFormatter.format(\"Mark\", \"Robert\", \"Mahoney\")","startRow":6,"startColumn":17,"endRow":6,"endColumn":66}],"imageURLs":["media/images/1662126039913-01.png"],"videoURLs":[],"audioURLs":[],"linesAbove":6,"linesBelow":1,"currentFilePath":"/03.exs","viewableBlogText":"defmodule NameFormatter do\n  def format(first, middle, last) do\n    \"#{last}, #{first} #{String.first(middle)}.\"\n  end\nend\n\nformatted_name = NameFormatter.format(\"Mark\", \"Robert\", \"Mahoney\")\nIO.puts(formatted_name)","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-311":[{"id":"commentId-5","displayCommentEvent":{"id":"ev-311","timestamp":1660861296198,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":311,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-310","lineNumber":11,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660862183091,"commentText":"Here I call the same function but I pass in some different arguments. The attached screenshot shows the results.<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"formatted_name = NameFormatter.format(\"John\", \"Fitzgerald\", \"Kennedy\")\nIO.puts(formatted_name)","startRow":9,"startColumn":0,"endRow":10,"endColumn":23}],"imageURLs":["media/images/1662126099812-02.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/03.exs","viewableBlogText":"formatted_name = NameFormatter.format(\"John\", \"Fitzgerald\", \"Kennedy\")\nIO.puts(formatted_name)","commentTags":["successful-run","image"],"questionCommentData":null}],"ev-457":[{"id":"commentId-6","displayCommentEvent":{"id":"ev-457","timestamp":1660861623723,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":457,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-456","lineNumber":18,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660862226853,"commentText":"<div>Not everyone has a middle name. Next, I'll add a new version of the function that takes a first and last name only.&nbsp;</div><div><br></div><div>This is a new function that has the same name as another one but has a different number of parameters.&nbsp;</div><div><br></div><div>Elixir programmers refer to the one starting on line 6 as <span style=\"font-family: Courier;\">format/2</span> because it is the version of the function that takes 2 parameters.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"def format(first, last) do\n    \"#{last}, #{first}\"\n  end","startRow":5,"startColumn":2,"endRow":7,"endColumn":5}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":5,"linesBelow":1,"currentFilePath":"/03.exs","viewableBlogText":"defmodule NameFormatter do\n  def format(first, middle, last) do\n    \"#{last}, #{first} #{String.first(middle)}.\"\n  end\n\n  def format(first, last) do\n    \"#{last}, #{first}\"\n  end\nend","commentTags":[],"questionCommentData":null},{"id":"commentId-17","displayCommentEvent":{"id":"ev-457","timestamp":1660861623723,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":457,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-456","lineNumber":18,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660948030385,"commentText":"<div>The function that begins on line 2 is referred to as <span style=\"font-family: Courier;\">format/3</span>.&nbsp;</div><div><br></div><div>The number at the end of this notation is called the 'arity' of a function. You see this a lot in Elixir documentation. It always refers to the number of parameters that a function takes.</div><div><br></div><div>The Elixir runtime will make sure the correct version of a function is called based on the number of parameters and by pattern matching (which we will talk about soon).<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"def format(first, middle, last) do\n    \"#{last}, #{first} #{String.first(middle)}.\"\n  end","startRow":1,"startColumn":2,"endRow":3,"endColumn":5}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":1,"linesBelow":5,"currentFilePath":"/03.exs","viewableBlogText":"defmodule NameFormatter do\n  def format(first, middle, last) do\n    \"#{last}, #{first} #{String.first(middle)}.\"\n  end\n\n  def format(first, last) do\n    \"#{last}, #{first}\"\n  end\nend","commentTags":[],"questionCommentData":null},{"id":"commentId-7","displayCommentEvent":{"id":"ev-457","timestamp":1660861623723,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":457,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-456","lineNumber":18,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660862236844,"commentText":"<div>On line 17&nbsp;Elixir looks for a function named <span style=\"font-family: Courier;\">format</span> in the <span style=\"font-family: Courier;\">NameFormatter</span> module that matches the number of arguments with the parameters.&nbsp;</div><div><br></div><div>The function <span style=\"font-family: Courier;\">format/2</span> gets called. The attached screenshot shows the results.</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"formatted_name = NameFormatter.format(\"Jack\", \"Kerouak\")\nIO.puts(formatted_name)","startRow":16,"startColumn":0,"endRow":17,"endColumn":23}],"imageURLs":["media/images/1662126256320-03.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/03.exs","viewableBlogText":"formatted_name = NameFormatter.format(\"Jack\", \"Kerouak\")\nIO.puts(formatted_name)","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-675":[{"id":"commentId-8","displayCommentEvent":{"id":"ev-675","timestamp":1660861698174,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":675,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-674","lineNumber":28,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660862265843,"commentText":"Here is another version of the <span style=\"font-family: Courier;\">format</span> function, <span style=\"font-family: Courier;\">format/1</span>, for stars that only go by one name.<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"def format(sole_name) do\n    \"The one and only #{sole_name}\"\n  end","startRow":9,"startColumn":2,"endRow":11,"endColumn":5}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":9,"linesBelow":1,"currentFilePath":"/03.exs","viewableBlogText":"defmodule NameFormatter do\n  def format(first, middle, last) do\n    \"#{last}, #{first} #{String.first(middle)}.\"\n  end\n\n  def format(first, last) do\n    \"#{last}, #{first}\"\n  end\n\n  def format(sole_name) do\n    \"The one and only #{sole_name}\"\n  end\nend","commentTags":[],"questionCommentData":null},{"id":"commentId-9","displayCommentEvent":{"id":"ev-675","timestamp":1660861698174,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":675,"type":"INSERT","fileId":"fileId-0","character":")","previousNeighborId":"ev-674","lineNumber":28,"column":23,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660862278770,"commentText":"Here I call the new function a couple of times (see the attached screenshot).<br>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"formatted_name = NameFormatter.format(\"Prince\")\nIO.puts(formatted_name)\n\nformatted_name = NameFormatter.format(\"Cher\")\nIO.puts(formatted_name)","startRow":23,"startColumn":0,"endRow":27,"endColumn":23}],"imageURLs":["media/images/1662126304969-04.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/03.exs","viewableBlogText":"formatted_name = NameFormatter.format(\"Prince\")\nIO.puts(formatted_name)\n\nformatted_name = NameFormatter.format(\"Cher\")\nIO.puts(formatted_name)","commentTags":["image","successful-run"],"questionCommentData":null}],"ev-773":[{"id":"commentId-10","displayCommentEvent":{"id":"ev-773","timestamp":1660861742856,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":773,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-724","lineNumber":4,"column":6,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1660862309785,"commentText":"<div>Ok, now things are going to get interesting.&nbsp;</div><div><br></div><div>Sometimes people named \"John\" also go by the name \"Jack\". I will handle this case by writing a specialized function instead of muddying the original one by writing an <span style=\"font-family: Courier;\">if</span> statement.<br><div><br></div></div><div>A new version of the <span style=\"font-family: Courier;\">format/3</span> function begins on line 2 but this one has a hard coded value for the first parameter, \"John\".&nbsp;</div><div><br></div><div>When Elixir sees a call to <span style=\"font-family: Courier;\">format/3</span>&nbsp;it will try and find a match between any function with a hard coded value like this. If it finds one, then that version will be called.<br></div>","commentTitle":"More Matching","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"def format(\"John\", middle, last) do\n    \"#{last}, John (Jack) #{String.first(middle)}.\"\n  end","startRow":1,"startColumn":2,"endRow":3,"endColumn":5}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":1,"linesBelow":13,"currentFilePath":"/03.exs","viewableBlogText":"defmodule NameFormatter do\n  def format(\"John\", middle, last) do\n    \"#{last}, John (Jack) #{String.first(middle)}.\"\n  end\n\n  def format(first, middle, last) do\n    \"#{last}, #{first} #{String.first(middle)}.\"\n  end\n\n  def format(first, last) do\n    \"#{last}, #{first}\"\n  end\n\n  def format(sole_name) do\n    \"The one and only #{sole_name}\"\n  end\nend","commentTags":[],"questionCommentData":null},{"id":"commentId-11","displayCommentEvent":{"id":"ev-773","timestamp":1660861742856,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":773,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-724","lineNumber":4,"column":6,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1660862325485,"commentText":"<div>On line 22 the name \"John\" is passed in as the first argument.&nbsp;</div><div><br></div><div>Elixir checks all of the <span style=\"font-family: Courier;\">format/3</span> functions&nbsp;and sees a match with the one that starts on line 2. So, that one is called and \"Jack\" shows up in the output (see the attached screenshot).<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"\"John\"","startRow":21,"startColumn":38,"endRow":21,"endColumn":44}],"imageURLs":["media/images/1662126432311-05.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":1,"currentFilePath":"/03.exs","viewableBlogText":"formatted_name = NameFormatter.format(\"John\", \"Fitzgerald\", \"Kennedy\")\nIO.puts(formatted_name)","commentTags":["image","successful-run"],"questionCommentData":null},{"id":"commentId-12","displayCommentEvent":{"id":"ev-773","timestamp":1660861742856,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":773,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-724","lineNumber":4,"column":6,"pastedEventId":null},"developerGroupId":"devGroupId-2","timestamp":1660862336359,"commentText":"<div>In the call on line 19, there is <span style=\"font-style: italic;\">not</span> a match between \"Mark\" and \"John\" so the next <span style=\"font-family: Courier;\">format/3</span> is checked. The one on line 6 is called.&nbsp;</div><div><br></div><div>Elixir checks all of the <span style=\"font-family: Courier;\">format/3</span> functions from the top of the module to the bottom. The first one where the arguments match the parameters is called.</div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"first","startRow":5,"startColumn":13,"endRow":5,"endColumn":18},{"fileId":"fileId-0","selectedText":"Mark","startRow":18,"startColumn":39,"endRow":18,"endColumn":43}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":5,"linesBelow":1,"currentFilePath":"/03.exs","viewableBlogText":"defmodule NameFormatter do\n  def format(\"John\", middle, last) do\n    \"#{last}, John (Jack) #{String.first(middle)}.\"\n  end\n\n  def format(first, middle, last) do\n    \"#{last}, #{first} #{String.first(middle)}.\"\n  end\n\n  def format(first, last) do\n    \"#{last}, #{first}\"\n  end\n\n  def format(sole_name) do\n    \"The one and only #{sole_name}\"\n  end\nend\n\nformatted_name = NameFormatter.format(\"Mark\", \"Robert\", \"Mahoney\")\nIO.puts(formatted_name)","commentTags":[],"questionCommentData":null}],"ev-984":[{"id":"commentId-13","displayCommentEvent":{"id":"ev-984","timestamp":1660861802374,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":984,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-983","lineNumber":30,"column":24,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660862365124,"commentText":"<div>Here is another version of <span style=\"font-family: Courier;\">format/3</span> that handles people named \"Robert\". It adds the colloquial name \"Bob\" to the output.</div><div><br></div><div>It is important that this function is above the general <span style=\"font-family: Courier;\">format/3</span> starting on line 10 because the different versions of <span style=\"font-family: Courier;\">format/3</span> will be checked for a match from the top of the module to the bottom.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"\"Robert\"","startRow":5,"startColumn":13,"endRow":5,"endColumn":21},{"fileId":"fileId-0","selectedText":"Robert (Bob)","startRow":6,"startColumn":14,"endRow":6,"endColumn":26}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":4,"linesBelow":5,"currentFilePath":"/03.exs","viewableBlogText":"  def format(\"John\", middle, last) do\n    \"#{last}, John (Jack) #{String.first(middle)}.\"\n  end\n\n  def format(\"Robert\", middle, last) do\n    \"#{last}, Robert (Bob) #{String.first(middle)}.\"\n  end\n\n  def format(first, middle, last) do\n    \"#{last}, #{first} #{String.first(middle)}.\"\n  end","commentTags":[],"questionCommentData":null},{"id":"commentId-15","displayCommentEvent":{"id":"ev-984","timestamp":1660861802374,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":984,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-983","lineNumber":30,"column":24,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660869738413,"commentText":"<div>The call on line 29 matches this new function and is executed (see the attached screenshot).</div><div><br></div><div>Elixir checks the version with \"Jack\" first but determines that there is not a match. Then it tries the next <span style=\"font-family: Courier;\">format/3</span> associated with \"Robert\" and finds a match. That version of the function is then executed. See the attached screenshot.<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Robert","startRow":28,"startColumn":39,"endRow":28,"endColumn":45}],"imageURLs":["media/images/1662126688383-06.png"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":1,"currentFilePath":"/03.exs","viewableBlogText":"formatted_name = NameFormatter.format(\"Robert\", \"Francis\", \"Kennedy\")\nIO.puts(formatted_name)","commentTags":["image","successful-run"],"questionCommentData":null},{"id":"commentId-16","displayCommentEvent":{"id":"ev-984","timestamp":1660861802374,"createdByDevGroupId":"devGroupId-2","eventSequenceNumber":984,"type":"INSERT","fileId":"fileId-0","character":"NEWLINE","previousNeighborId":"ev-983","lineNumber":30,"column":24,"pastedEventId":"other"},"developerGroupId":"devGroupId-2","timestamp":1660870269341,"commentText":"To recap, Elixir handles the call on line 23 like this:<br>- check for a match between \"Mark\" and \"John\", no match<br><div>- check for a match between \"Mark\" and \"Robert\", no match</div><div>- call the default version of <span style=\"font-family: Courier;\">format/3</span> starting on line 10<br></div>","commentTitle":"","selectedCodeBlocks":[{"fileId":"fileId-0","selectedText":"Mark","startRow":22,"startColumn":39,"endRow":22,"endColumn":43}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/03.exs","viewableBlogText":"formatted_name = NameFormatter.format(\"Mark\", \"Robert\", \"Mahoney\")","commentTags":["question","successful-run"],"questionCommentData":{"allAnswers":["format/2","format/3 with \"John\" as the first parameter","format/3","There will be a match error"],"correctAnswer":"format/2","question":"Which version of <span style=\"font-family: Courier;\">format</span> will be called with this code:<br><br><span style=\"font-family: Courier;\">NameFormatter.format(\"John\", \"Legend\")</span><br>","explanation":"The function call only has two arguments so that trumps all of the matching in <span style=\"font-family: Courier;\">format/3</span>.<br>"}}]};
